import React, { Component } from 'react'
import { Input, TopTags } from '../index.js'

class Aside extends Component {
	constructor(props) {
		super(props);
		this.state = {};
	}

	render() {
		return (
			<>
				<Input />
				<TopTags data={this.props.data}/>
			</>
		);
	}
}

export default Aside;
